import "./index.css";

// async & await

const getImagen = async () => {
  const respuesta = await fetch(
    `https://pokeapi.co/api/v2/pokemon-form/${Math.floor(Math.random() * 800)}/`
  );
  const data = await respuesta.json();
  return data;
};

console.log(getImagen());
